      SELECT DISTINCT 56 - - col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col2 * col0 + col2 + - - col0 + - 95 * + 71 + + ( - col2 ) IS NULL;
  - name: tab1

outputs:
